import { merge } from 'rxjs';

class App extends Component {

  state = {
    username: "whatever"
  }

  updateUsernameHandler = () => {
    console.log("2")
  }

  render() {
    return (
      <div className="App">
        <UserInput inputChangedHandler={this.updateUsernameHandler}/>
        <UserOutput username={this.state.username}/>
        <UserOutput username={this.state.username}/>
        <UserOutput username={this.state.username}/>
      </div>
    );
  }
}

export default App;
